('2340','2','8324-1','Whg. Palvil',Null,'Diverse Apartments in beliebter Wohnanlage zu verkaufen, Santa Ponsa','32987','Diese Wohnanlage steht auf dem Hausberg von Santa Ponsa im Süd-Westen Mallorcas mit einem fantastischen Blick auf die Bucht von Santa Ponsa und das Tramuntana Gebirge. In unmittelbarer Umgebung befinden sich mehrere Golfplätze, Jachthäfen, Supermärkte, schicke Restaurants und intern. Schulen. Die Wohnanlage wurde 1986 erstellt und die Fassaden im Jahr 2014 komplett saniert. Die hier angebotenen Wohnungen und Dublex Apartments haben 2-3 Schlafzimmer und eine Wohnfläche zwischen 78m² und 128m² plus großzügige Terrassen. Die Verkaufspreise liegen zwischen 385.000€ und 450.000€. Alle Wohnungen und Apartments haben einen überdachten Autostellplatz und teilweise auch separate Abstellräume von 3m². Ein Außenpool mit Liegestühlen zum Relaxen rundet das Angebot ab','32988','450000','106','2015-06-11 11:56:15','106','2015-06-11 11:56:46',Null,'2407','121','1132',1,'1','0',Null,Null,Null,'32989',Null,'0','0','0',Null,'2015-06-11 12:19:33',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32990',Null,'32991',Null,'32992',Null,'32993',Null,'32994','0',0,'4');
